import React from "react";

const MovieCard =({movie1}) => {
  return(
<div className='movie'>
    <div>
        <p>1999</p>
    </div>

    <div>
        <img 
        src={'https://m.media-amazon.com/images/M/MV5BYTYxNGMyZTYtMjE3MS00MzNjLWFjNmYtMDk3N2FmM2JiM2M1XkEyXkFqcGdeQXVyNjY5NDU4NzI@._V1_.jpg'} 
        
        alt={'https://m.media-amazon.com/images/M/MV5BYTYxNGMyZTYtMjE3MS00MzNjLWFjNmYtMDk3N2FmM2JiM2M1XkEyXkFqcGdeQXVyNjY5NDU4NzI@._V1_.jpg'}></img>
    </div>
    <div>
      <span>{movie1.Genre}</span>
      <h3>{movie1.Title}</h3>
    </div>
    </div>
  )

  
}

export default MovieCard;
